\begin{code}
function [diff] = objective_function(x, y, r, U, pi_true)

% Calculate pi_model using given parameter values
fc = x(1);
cc = x(2);
dscale = x(3);
dshape = x(4);
pi_model = calculate_pi(y, r, U, fc, cc, dscale, dshape);

% Calculate difference between summary statistics of pi_true and pi_model
diff_avg = mean(pi_true) - mean(pi_model);
diff_std = std(pi_true) - std(pi_model);
diff_max = max(pi_true) - max(pi_model);
diff_min = min(pi_true) - min(pi_model);
diff_decile = sum(abs(prctile(pi_true, 1:10) - prctile(pi_model, 1:10)));

% Combine differences into a single scalar value
diff = diff_avg^2 + diff_std^2 + diff_max^2 + diff_min^2 + diff_decile^2;
\end{code}

